<?php

declare(strict_types=1);

namespace PhpLlm\LlmChain\Tests\Bridge\Google;

use PhpLlm\LlmChain\Bridge\Google\GooglePromptConverter;
use PhpLlm\LlmChain\Model\Message\AssistantMessage;
use PhpLlm\LlmChain\Model\Message\Content\File;
use PhpLlm\LlmChain\Model\Message\Content\Image;
use PhpLlm\LlmChain\Model\Message\Message;
use PhpLlm\LlmChain\Model\Message\MessageBag;
use PhpLlm\LlmChain\Model\Message\UserMessage;
use PHPUnit\Framework\Attributes\CoversClass;
use PHPUnit\Framework\Attributes\DataProvider;
use PHPUnit\Framework\Attributes\Small;
use PHPUnit\Framework\Attributes\Test;
use PHPUnit\Framework\Attributes\UsesClass;
use PHPUnit\Framework\TestCase;

#[Small]
#[CoversClass(GooglePromptConverter::class)]
#[UsesClass(UserMessage::class)]
#[UsesClass(AssistantMessage::class)]
#[UsesClass(MessageBag::class)]
#[UsesClass(File::class)]
final class GooglePromptConverterTest extends TestCase
{
    #[Test]
    #[DataProvider('provideMessageBag')]
    public function testConvert(MessageBag $bag, array $expected): void
    {
        $converter = new GooglePromptConverter();

        self::assertSame($expected, $converter->convertToPrompt($bag));
    }

    /**
     * @return iterable<array{0: MessageBag, 1: array}>
     */
    public static function provideMessageBag(): iterable
    {
        yield 'simple text' => [
            new MessageBag(Message::ofUser('Write a story about a magic backpack.')),
            [
                'contents' => [
                    ['role' => 'user', 'parts' => [['text' => 'Write a story about a magic backpack.']]],
                ],
            ],
        ];

        yield 'text with image' => [
            new MessageBag(
                Message::ofUser('Tell me about this instrument', Image::fromFile(dirname(__DIR__, 2).'/Fixture/image.jpg'))
            ),
            [
                'contents' => [
                    ['role' => 'user', 'parts' => [
                        ['text' => 'Tell me about this instrument'],
                        ['inline_data' => ['mime_type' => 'image/jpeg', 'data' => '']], ]],
                ],
            ],
        ];

        yield 'with assistant message' => [
            new MessageBag(
                Message::ofUser('Hello'),
                Message::ofAssistant('Great to meet you. What would you like to know?'),
                Message::ofUser('I have two dogs in my house. How many paws are in my house?'),
            ),
            [
                'contents' => [
                    ['role' => 'user', 'parts' => [['text' => 'Hello']]],
                    ['role' => 'model', 'parts' => [['text' => 'Great to meet you. What would you like to know?']]],
                    ['role' => 'user', 'parts' => [['text' => 'I have two dogs in my house. How many paws are in my house?']]],
                ],
            ],
        ];

        yield 'with system messages' => [
            new MessageBag(
                Message::forSystem('You are a cat. Your name is Neko.'),
                Message::ofUser('Hello there'),
            ),
            [
                'contents' => [
                    ['role' => 'user', 'parts' => [['text' => 'Hello there']]],
                ],
                'system_instruction' => [
                    'parts' => ['text' => 'You are a cat. Your name is Neko.'],
                ],
            ],
        ];
    }
}
